import React from "react";
import Menu from "./Menu";
export default function Header() {
  return (
    <header className="col-12 bg-dark" style={{ height: "70px" }}>
      <div className="justify-between row">
        <figure className="col-3" style={{ height: "100%" }}></figure>
        <div className="col-7">
          <Menu />
        </div>
      </div>
    </header>
  );
}
